(79, 'widget_text', 'a:5:{i:2;a:3:{s:5:"title";s:11:"Our Service";s:4:"text";s:902:"<div class="col-lg-3 col-md-3 col-sm-3">\r\n              <div class="single-footer-widget">\r\n                <div class="section-heading">\r\n                <h2>Our Service</h2>\r\n                <div class="line"></div>\r\n              </div>\r\n              <ul class="footer-service">\r\n                <li><a href="http://truelabllc.com/"><span class="fa fa-check"></span>Home</a></li>\r\n                <li><a href="http://truelabllc.com/about-us"><span class="fa fa-check"></span>About Us</a></li>\r\n                <li><a href="http://truelabllc.com/services/"><span class="fa fa-check"></span>Services</a></li>\r\n                <li><a href="http://truelabllc.com/careers/"><span class="fa fa-check"></span>Career</a></li>\r\n                <li><a href="http://truelabllc.com/contact-us/"><span class="fa fa-check"></span>Contact Us</a></li>\r\n              </ul>\r\n              </div>\r\n            </div>";s:6:"filter";b:0;}i:3;a:3:{s:5:"title";s:8:"About Us";s:4:"text";s:462:"<div class="col-lg-3 col-md-3 col-sm-3">\r\n              <div class="single-footer-widget">\r\n                <div class="section-heading">\r\n                <h2>About Us</h2>\r\n                <div class="line"></div>\r\n              </div>           \r\n              <p>TrueLab is a CLIA Waived-certified laboratory specializing on use of point of care devices (POC) to deliver fast and reliable results to our clients. </p>\r\n              </div>\r\n            </div>";s:6:"filter";b:0;}i:5;a:3:{s:5:"title";s:12:"Contact Info";s:4:"text";s:704:"<div class="col-lg-3 col-md-3 col-sm-3">\r\n              <div class="single-footer-widget">\r\n                <div class="section-heading">\r\n                <h2>Contact Info</h2>\r\n                <div class="line"></div>\r\n              </div>\r\n              <address class="contact-info">\r\n                <!-- <p><span class="fa fa-home"></span>305 Intergraph Way\r\n                Madison, AL 35758, USA</p> -->\r\n                <p><span class="fa fa-phone"></span>(708) 620-5790</p>\r\n                <p><span class="fa fa-fax"></span>(708) 650-5215</p>\r\n                <p><span class="fa fa-envelope"></span>helpdesk@truelabllc.com</p>\r\n              </address>\r\n              </div>\r\n            </div>";s:6:"filter";b:0;}i:6;a:3:{s:5:"title";s:4:"Tags";s:4:"text";s:656:"<div class="col-lg-3 col-md-3 col-sm-3">\r\n              <div class="single-footer-widget">\r\n                <div class="section-heading">\r\n                <h2>Tags</h2>\r\n                <div class="line"></div>\r\n              </div>\r\n                <ul class="tag-nav">\r\n                  <li><a href="http://truelabllc.com/tag/poc/">POC</a></li>\r\n                  <li><a href="http://truelabllc.com/tag/diabetes/">Diabetes</a></li>\r\n                  \r\n                  <li><a href="http://truelabllc.com/tag/blood-clotting/">blood clotting</a></li>\r\n                  \r\n                \r\n                </ul>\r\n              </div>\r\n            </div>";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
