(1, 1, '2017-04-12 13:39:35', '2017-04-12 13:39:35', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2017-04-12 13:39:35', '2017-04-12 13:39:35', '', 0, 'http://truelabllc.com//?p=1', 0, 'post', '', 1),
(2, 1, '2017-04-12 13:39:35', '2017-04-12 13:39:35', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n\r\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\r\n\r\n...or something like this:\r\n\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\n\r\nAs a new WordPress user, you should go to <a href="http://truelabllc.com//wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2017-04-18 13:03:36', '2017-04-18 13:03:36', '', 0, 'http://truelabllc.com//?page_id=2', 0, 'page', '', 0),
(24, 1, '2017-04-14 09:53:25', '2017-04-14 09:53:25', '<li>\r\n[text* text-518 class:wp-form-control placeholder "Your first name"]\r\n</li>\r\n<li>\r\n[text* text-885 class:wp-form-control placeholder "Your last name"]\r\n</li>\r\n<li>\r\n[email* email-794 class:wp-form-control placeholder "Your email id"]\r\n</li>\r\n<li>\r\n[tel* tel-157 class:wp-form-control placeholder "Your cell number"]\r\n</li>\r\n<li>\r\n[select* menu-838 class:wp-form-control "Select Department" "Phlebotomist"]\r\n</li>\r\n<li>\r\n[file file-663 limit:5mb class:wp-form-control]\r\n</li>\r\n<li>\r\n[textarea textarea-170 class:wp-form-control placeholder "What would you like to tell us"]\r\n</li>\r\n<li>\r\n<button class="wpcf7-submit button--itzel" type="submit"><i class="button__icon fa fa-envelope"></i><span>Send Message</span></button>\r\n</li>\n1\nTruelabllc "[text-123]"\n[text-518] [text-885]<wordpress@truelabllc.com>\nhelpdesk@truelabllc.com\nFrom: [text-518] [text-885] <[email-794]>\r\nApplied for: [menu-838]\r\nPhone:[tel-157]\r\nMessage:[textarea-170]\nReply-To: [email-794]\n[file-663]\n\n\n\n\n\n\n\n\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2017-04-25 05:36:46', '2017-04-25 05:36:46', '', 0, 'http://truelabllc.com//?post_type=wpcf7_contact_form&#038;p=24', 0, 'wpcf7_contact_form', '', 0),
