(157, 1, '2017-04-20 06:47:25', '2017-04-20 06:47:25', 'The PT and INR are used to monitor the effectiveness of the anticoagulant warfarin. This drug affects the function of the coagulation cascade and helps inhibit the formation of blood clots. It is prescribed on a long-term basis to people who have experienced recurrent inappropriate blood clotting. The goal of warfarin therapy is to maintain a balance between preventing clots and causing excessive bleeding. This balance requires careful monitoring. The INR can be used to adjust a person''s drug dosage to get the PT into the desired range that is right for the person and his or her condition.', 'PT/INR Testing', '', 'publish', 'open', 'open', '', 'service-3', '', '', '2017-04-25 07:02:45', '2017-04-25 07:02:45', '', 0, 'http://truelabllc.com//?p=157', 0, 'post', '', 0),
(191, 1, '2017-04-22 04:44:24', '2017-04-22 04:44:24', 'PT is the abbreviation for “prothrombin time.” Prothrombin time is just a measure of how quickly your blood clots.\r\nINR is an abbreviation for “International Normalized Ratio.” This is the unit of measure that’s used to determine how quickly your blood is clotting.', 'PT/INR Testing', '', 'inherit', 'closed', 'closed', '', '157-revision-v1', '', '', '2017-04-22 04:44:24', '2017-04-22 04:44:24', '', 157, 'http://truelabllc.com/157-revision-v1/', 0, 'revision', '', 0),
