(190, 1, '2017-04-24 02:52:13', '2017-04-24 02:52:13', 'The PT and INR are used to monitor the effectiveness of the anticoagulant warfarin. This drug affects the function of the coagulation cascade and helps inhibit the formation of blood clots. It is prescribed on a long-term basis to people who have experienced recurrent inappropriate blood clotting. The goal of warfarin therapy is to maintain a balance between preventing clots and causing excessive bleeding. This balance requires careful monitoring. The INR can be used to adjust a person''s drug dosage to get the PT into the desired range that is right for the person and his or her condition.', 'PT/INR Testing', '', 'inherit', 'closed', 'closed', '', '157-autosave-v1', '', '', '2017-04-24 02:52:13', '2017-04-24 02:52:13', '', 157, 'http://truelabllc.com/157-autosave-v1/', 0, 'revision', '', 0),
