(195, 1, '2017-04-22 04:50:18', '2017-04-22 04:50:18', '<p>TrueLab is a CLIA Waived-certified laboratory specializing on use of point of care devices (POC) to deliver fast and reliable results to our clients. We understand how critical it is to know the results right away in order for your health care provider to prevent, diagnose and treat the disease.</p>', 'ABOUT US', '', 'inherit', 'closed', 'closed', '', '92-revision-v1', '', '', '2017-04-22 04:50:18', '2017-04-22 04:50:18', '', 92, 'http://truelabllc.com/92-revision-v1/', 0, 'revision', '', 0),
(196, 1, '2017-04-22 04:54:56', '2017-04-22 04:54:56', 'The PT and INR are used to monitor the effectiveness of the anticoagulant warfarin. This drug affects the function of the coagulation cascade and helps inhibit the formation of blood clots. It is prescribed on a long-term basis to people who have experienced recurrent inappropriate blood clotting. The goal of warfarin therapy is to maintain a balance between preventing clots and causing excessive bleeding. This balance requires careful monitoring. The INR can be used to adjust a person''s drug dosage to get the PT into the desired range that is right for the person and his or her condition.', 'PT/INR Testing', '', 'inherit', 'closed', 'closed', '', '157-revision-v1', '', '', '2017-04-22 04:54:56', '2017-04-22 04:54:56', '', 157, 'http://truelabllc.com/157-revision-v1/', 0, 'revision', '', 0),
