(18, 18, 'post_tag', 'The A1C test is a blood test that provides information about a person’s average levels of blood glucose, also called blood sugar, over the past 3 months. The A1C test is sometimes called the hemoglobin A1c, HbA1c, or glycohemoglobin test. The A1C test is the primary test used for diabetes management and diabetes research. The A1C test is based on the attachment of glucose to hemoglobin, the protein in red blood cells that carries oxygen. In the body, red blood cells are constantly forming and dying, but typically they live for about 3 months. Thus, the A1C test reflects the average of a person’s blood glucose levels over the past 3 months. The A1C test result is reported as a percentage. The higher the percentage, the higher a person’s blood glucose levels have been. A normal A1C level is below 5.7 percent.\r\n\r\n', 0, 1),
(24, 24, 'post_tag', 'The PT and INR are used to monitor the effectiveness of the anticoagulant warfarin. This drug affects the function of the coagulation cascade and helps inhibit the formation of blood clots. It is prescribed on a long-term basis to people who have experienced recurrent inappropriate blood clotting. The goal of warfarin therapy is to maintain a balance between preventing clots and causing excessive bleeding. This balance requires careful monitoring. The INR can be used to adjust a person''s drug dosage to get the PT into the desired range that is right for the person and his or her condition.', 0, 1),
(27, 27, 'post_tag', 'TrueLab is a CLIA Waived-certified laboratory specializing on use of point of care devices (POC) to deliver fast and reliable results to our clients. We understand how critical it is to know the results right away in order for your health care provider to prevent, diagnose and treat the disease.', 0, 1);
